                <div className="contAbout">
                    <Row>
                        <Col className="col" xs="12" sm="12" md="12" lg="12" style={{height: '500px'}}>
                            <h2>About Me</h2>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, 
